import axios from 'axios';

export const GET_PLACE = 'GET_PLACE';
export const GOT_PLACE = 'GOT_PLACE';
export const FAIL_PLACE = 'FAIL_PLACE';

export const getInfo = () => dispatch => {
  dispatch({type:GET_PLACE})
  axios 
    .get("http://localhost:5000/api/users/u")//console.log(data,'one')
    .then( response => dispatch({type:GET_LODGE_RE,payload:response.data}) )
    .catch( err => dispatch({type: GET_PLACE,payload:err} ) ) 
}
